        public static void BuildMenu(string fstrRole)
        {

            for (int i = 0; i < Shell.Current.Items.Count; i++)
            {
                Shell.Current.Items[i].IsVisible = false;
            }

            for (int i = 0; i < Shell.Current.Items.Count; i++)
            {
                for (int j = 0; j < AppSettings.RoleMenuAccess[fstrRole].Count; j++)
                {
                    if (Shell.Current.Items[i].Title != null)
                    {
                        if ("MNU" + Shell.Current.Items[i].Title.ToString().ToUpper() == AppSettings.RoleMenuAccess[fstrRole][j].ToString().ToUpper())
                        {
                            Shell.Current.Items[i].IsVisible = true;
                        }
                    }

                }

            }

        }


