            string url = AppSettings.getContentUrl + "DataSource/getCmsDetail?fstrAccessID=" + fstrAccessID;
            try
            {
                // prepare header parameters as per RSGT inputs
                var request = new HttpRequestMessage
                {
                    RequestUri = new Uri(url),
                    Method = HttpMethod.Get,
                    Headers = {
                        { "X-Version", "1" }, // HERE IS HOW TO ADD HEADERS,
                        { HttpRequestHeader.Authorization.ToString(), ApiKey },
                        { HttpRequestHeader.Accept.ToString(), "application/json, application/xml" },
                        { HttpRequestHeader.ContentType.ToString(), "application/json" },  //use this content type if you want to send more than one content type
                    },
                };
                // create a web client to call web api
                //HttpClient client = new HttpClient();
                //client.DefaultRequestHeaders.Authorization = new System.Net.Http.Headers.AuthenticationHeaderValue("ApiKey", "hl4bA4nB4yI0fC8fH7eT6");
                //client.DefaultRequestHeaders.Add("ApiKey", "hl4bA4nB4yI0fC8fH7eT6");
                ////  making request to web server as per given api inputs
                //var responseTask = client.SendAsync(request).Result;


                HttpClientHandler handler = new HttpClientHandler();
                handler.ServerCertificateCustomValidationCallback += (sender, cert, chain, sslPolicyErrors) => { return true; };
                HttpClient client = new HttpClient(handler);
                client.DefaultRequestHeaders.Add("ApiKey", "hl4bA4nB4yI0fC8fH7eT6");
                var responseTask = client.SendAsync(request).Result;


                // if request is responded successfully then we need to process output / result data 
                if (responseTask.IsSuccessStatusCode)
                {
                    var objOutputTask = responseTask.Content.ReadAsStringAsync();
                    objOutputTask.Wait();
                    var jss = new JavaScriptSerializer();
                    string lstrTemp = objOutputTask.Result;

                    ObservableCollection<Object> objCms;
                    objCms = JsonConvert.DeserializeObject<ObservableCollection<Object>>(lstrTemp);
                    ////var json = Newtonsoft.Json.Linq.JObject.Parse(lstrTemp);

                    List<InfoItem> cmsList;

                    cmsList = generateList(objCms);

                    foreach (IEnumerable<Object> X in objCms)
                    {
                        string name = ""; string value = "";
                        string value1 = "";
                        string value2 = "";

                        foreach (Newtonsoft.Json.Linq.JProperty y in X)
                        {
                            if (y.Name == "cms_infoid") // strTitle & strContent
                                name = (string)y.Value;
                            if ((y.Name == "cms_info1"))
                            {
                                value = (string)y.Value;
                                foreach (KeyValuePair<string, string[]> entry in fdicPageContent)
                                {
                                    if (entry.Key == name)
                                    {
                                        value1 = value;
                                    }
                                }
                            }
                            if ((y.Name == "cms_info2"))
                            {
                                value = (string)y.Value;
                                foreach (KeyValuePair<string, string[]> entry in fdicPageContent)
                                {
                                    if (entry.Key == name)
                                    {
                                        value2 = value;
                                    }
                                }
                            }
                        }
                        fdicPageContent[name] = new[] { value1, value2 };
                    }

                }
            }
            catch (Exception ex)
            {
                string lstrError = "";
                lstrError = ex.Message.ToString();
            }

            return fdicPageContent;

        }

