        //20230417-As per Govee Sir Instruction
        public static async Task<List<InfoItem>> LoadContent(string fstrAccessID)
        {
            string ApiKey = AppSettings.getApiKey;
            string AuthorizationKey = AppSettings.getApiAuthorizationKey;
            //ObservableCollection<Object> objCms = new ObservableCollection<object>();
            List<InfoItem> objCms = new List<InfoItem>();

            if (App.gblCMSSource.ToUpper().Trim() == "JSON")
            {

                string Encrypturl = AppSettings.MobCMSUrl;
                string strEncrptKey = AppSettings.getEncrptyKey;
                string lstrDycryptUrl = gblRegisteration.DecryptString(Encrypturl, strEncrptKey);
                string lstrFilePath = lstrDycryptUrl;
                //lstrFilePath = AppSettings.MobWebUrl;

                lstrFilePath += "/Json/" + fstrAccessID + ".txt";
                try
                {
                    // HttpClient implements a IDisposable interface
                    using (HttpClient client = new HttpClient())
                    {
                        //initiate Get Request 
                        using (HttpResponseMessage res = client.GetAsync(lstrFilePath).GetAwaiter().GetResult())
                        {
                            //convert response to c# object
                            using (HttpContent content = res.Content)
                            {
                                //convert data content to string using await
                                var data = await content.ReadAsStringAsync();

                                //If the data is not null, parse(deserialize) the data to a C# object
                                if (data != null)
                                {
                                    objCms = JsonConvert.DeserializeObject<List<InfoItem>>(data);
                                    return objCms;
                                }
                            }
                        }
                    }
                }
                catch (Exception ex)
                {

                    string lstrError = ex.Message;
                    return null;
                }

            }
            return null;
        }

