ODESC\":\"imglock\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"0\",\"CMS_SORTORDERBASE\":\"8400\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM001\",\"CMS_PAGENAME\":\"HeaderFooter\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"imgAboutImage\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"images/aboutimage.jpg\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"images/aboutimage.jpg\",\"CMS_CATEGORY\":\"Image\",\"CMS_GROUPREFERENCE\":\"\",\"CMS_INFODESC\":\"About Image\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"0\",\"CMS_SORTORDERBASE\":\"8500\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM001\",\"CMS_PAGENAME\":\"HeaderFooter\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strAboutRsgtTitle\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"About Rsgt\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"نبذة عن محطة بوابة البحر الأحمر\",\"CMS_CATEGORY\":\"LoV\",\"CMS_GROUPREFERENCE\":\"\",\"CMS_INFODESC\":\"AboutRsgtTitle\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"0\",\"CMS_SORTORDERBASE\":\"8700\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM001\",\"CMS_PAGENAME\":\"HeaderFooter\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strAboutRsgtTitle1\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"<p>Red Sea Gateway Terminal (RSGT) is the newest flagship container terminal at Jeddah Islamic Port, a world-class terminal spearheaded by the Saudi Industrial Services group SISCO, as well as the first privately funded BOT (Build Operate and Transfer) development project in Saudi Arabia with investment of USD 1.7 Billion up to 2050.</p>\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"<p>محطة بوابة البحر الأحمر (RSGT) هي أحدث محطة حاويات رئيسية في ميناء جدة الإسلامي ، وهي محطة عالمية المستوى تقودها مجموعة الخدمات الصناعية السعودية SISCO ، بالإضافة إلى أول مشروع تطوير BOT (بناء وتشغيل ونقل) ممول من القطاع الخاص في المملكة العربية السعودية العربية باستثمارات 1.7 مليار دولار حتى 2050.</p>\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strAboutRsgtTitle\",\"CMS_INFODESC\":\"AboutRsgtTitle1\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"1\",\"CMS_SORTORDERBASE\":\"8700\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"1\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM001\",\"CMS_PAGENAME\":\"HeaderFooter\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strAboutRsgtTitle2\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"<p>RSGT is an international terminal operator representing a partnership between the Red Sea Gateway Terminal of Saudi Arabia and the Malaysian Mining Company (MMC). The combined assets, handling capacity and experience place the terminal operations among the ten largest container terminal operators globally, with a combined annual handling capacity of 20 million TEUs, and equity-weighted throughput of over 10 million TEUS.</p>\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"<p>محطة بوابة البحر الأحمر هي مشغل محطات دولي يمثل شراكة بين محطة بوابة البحر الأحمر في المملكة العربية السعودية وشركة التعدين الماليزية (MMC). تضع الأصول المجمعة وسعة المناولة والخبرة عمليات المحطة بين أكبر عشرة مشغلين لمحطات الحاويات على مستوى العالم ، مع قدرة معالجة سنوية مجمعة تبلغ 20 مليون حاوية مكافئة ، وإنتاجية مرجحة بالأسهم تزيد عن 10 ملايين حاوية مكافئة.</p>\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strAboutRsgtTitle\",\"CMS_INFODESC\":\"AboutRsgtTitle2\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"2\",\"CMS_SORTORDERBASE\":\"8700\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"2\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM001\",\"CMS_PAGENAME\":\"HeaderFooter\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strAboutRsgtTitle3\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"<p>Located at the Port of Jeddah, the Red Sea Gateway Terminal was established in 2009 as Saudi Arabia's first private sector Build-Operate-Transfer project. Currently, with an annual container throughput capacity of 5.2 million TEUs, RSGT is providing world-class integrated logistics solutions, port operations in one of the world's 40 busiest container ports and serves as an engine of growth for both local and regional economies.</p>\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"<p>يقع في ميناء جدة ، تم إنشاء محطة بوابة البحر الأحمر في عام 2009 كأول مشروع بناء وتشغيل ونقل للقطاع الخاص في المملكة العربية السعودية. في الوقت الحالي ، مع قدرة إنتاجية سنوية للحاويات تبلغ 5.2 مليون حاوية مكافئة ، توفر RSGT حلول لوجستية متكاملة على مستوى عالمي وعمليات الموانئ في واحد من أكثر 40 ميناء للحاويات ازدحامًا في العالم وتعمل كمحرك للنمو للاقتصادات المحلية والإقليمية.</p>\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strAboutRsgtTitle\",\"CMS_INFODESC\":\"AboutRsgtTitle3\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"3\",\"CMS_SORTORDERBASE\":\"8700\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"3\",\"CMS_SUBACCESSID\":\"\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"}]";
