            else if (fstrAccessID == "RM009") // FAQs
            {
                string lstrTemp = "[{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion1\",\"CMS_Q1\":\"How do I access information about Container Status, Vessel Schedules & Inspection Details ?\",\"CMS_INFO1\":\"By visiting our website link belowe-TrackKindly be guided information regarding container moves and status are updated real time\",\"CMS_Q2\":\"كيف يمكنني الوصول إلى معلومات حول حالة الحاوية وجداول السفن وتفاصيل الجمارك ؟\",\"CMS_INFO2\":\"بواسطة زيارة موقعنا على الرابط التالي  e-Track يرجى الاسترشاد بالمعلومات المتعلقة بتحركات الحاويات وحالتها و التي  يتم تحديثها في وقتها الفعلي\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question1\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"1\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion2\",\"CMS_Q1\":\"When can I submit my documents to customs for clearance process?\",\"CMS_INFO1\":\"Documents can be uploaded on Saudi EDI prior vessel arrival, 72-48hrs before vessel arrival\",\"CMS_Q2\":\"متى يمكنني تقديم المستندات الخاصة بي إلى الجمارك لعملية التخليص الجمركي ؟\",\"CMS_INFO2\":\"يمكن تحميل الوثائق على المشروع السعودي لتبادل المعلومات الكترونيا قبل وصول السفينة خلال 48 - 72 ساعة قبل وصول السفينة\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question2\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"2\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion3\",\"CMS_Q1\":\"How do I make payment?\",\"CMS_INFO1\":\"Payment can be made on line (via ATM – Mobile APP as well) at Al Rajhi Bank RSGT bank account. Alternatively by visiting us at RSGT finance desk The particulars for online payment are listed below:Account No: 577608010017187IBAN: SA5980000577608010017187 Account Name: Red Sea Gateway Terminal Company Limited Bank Name: Al Rajhi Bank Branch Code: 577 Swift Code: RJHISARI Address: Al Andalus St.,Al Suhaily Center,PO Box 605,Jeddah 21421,Kingdom Of Saudi Arabia\",\"CMS_Q2\":\"كيف أقوم بالدفع ؟\",\"CMS_INFO2\":\"يمكن القيام بالدفع عبر الطرق الالكترونية ( أجهزة الصراف الآلي - تطبيقات البنوك من خلال الجوال ) الى حساب محطة البحر الأحمر في مصرف الراجحي أو من خلال زيارة قسم المالية في مكتبنا  تفاصيل الدفع الالكتروني مذكورة أدناه: رقم الحساب :  577608010017187 رقم الايبان : SA5980000577608010017187 اسم الحساب : شركة محطة بوابة البحر الأحمر المحدودة  اسم البنك : مصرف الراجحي  رقم الفرع : 577 Swift Code: RJHISARI العنوان : شارع الأندلس , مركز السحيلي , ص. ب. : 605 , جدة : 21421 , المملكة العربية السعودية\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question3\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"3\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion4\",\"CMS_Q1\":\"Where can I find my invoices?\",\"CMS_INFO1\":\"Invoices can be accessed per below: 1) By sending request per e - mail(include BL # / Bayan / Container number please) to:rsgtinvoice@rsgt.com, CC: c.s@rsgt.com  2) Alternatively by visiting us at RSGT finance desk(Saturday to Thursday from 8 am to 8 pm, Friday 2 pm to 4 pm)\",\"CMS_Q2\":\"أين أجد فواتيري ؟\",\"CMS_INFO2\":\"أين أجد فواتيري ؟ يمكن الحصول على الفواتير من خلال : 1. ارسال طلب عبر البريد الالكتروني يتضمن  ( بوليصة الشحن , البيان الجمركي, رقم الحاوية ) الى العنوان  RSGTinvoice@rsgt.com و نسخة الى :  c.s@rsgt.co 2. زيارة القسم المالية ( من السبت الى الخميس من 8 ص الى 8 م , الجمعة من 2 م الى 4 م )\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question4\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"4\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion5\",\"CMS_Q1\":\"How do I contact for any query or support?\",\"CMS_INFO1\":\"Please use below communication channel per your convenience:Email: c.s@rsgt.com  Phone: 920007025(Toll Free), from 8 am up to 7 pm all days except Friday  WhatsApp 0300073693  Face to face at customer relations front office desk, from 7 am up to 7 pm Sunday to Thursday and from 8 am to 1 pm on Saturday\",\"CMS_Q2\":\"ماهي طرق التواصل للاستعلام أو طلب الدعم ؟\",\"CMS_INFO2\":\"يرجى استخدام أي من قنوات التواصل التالية :  البريد الالكتروني : C.S@rsgt.com الهاتف المجاني :  920007025 من الساعة 8 ص حتى 7 م يوميا ما عدا الجمعة  الواتساب :  0300073693  مقابلة أحد أعضائنا في مكتب علاقات العملاء من الأحد الى الخميس من الساعة  7 ص الى 7 م و السبت من 8 ص الى 1 م\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question5\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"5\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion6\",\"CMS_Q1\":\"Which Value added services are provided in terminal?\",\"CMS_INFO1\":\"We endeavor to facilitate our customers supply chain requirements optimally possible.Pleas feel free and approach our Customer Relations team for any query or support and services The following services are provided as standard product:-Customs Clearance  -Transportation  -Front Desk Customer Support  -24 / 7 Operations including cargo deliveries -Container status reporting -Sorting Services -Customized online reporting to enhance visibility-E -services  -Ware house(bonded and non) facility -Container weight verification -OCR smart gate-Scan upon container discharge-Dedicated personalized contact\",\"CMS_Q2\":\"ماهي الخدمات الاضافية التي تقدمها المحطة ؟\",\"CMS_INFO2\":\"نحن نسعى لتسهيل متطلبات  التوريد لعملائنا على النحو الأمثل. فلا تتردد في التواصل مع فريق علاقات العملاء لدينا لأي استفسار أو دعم أو خدمات يتم توفير الخدمات التالية كمنتج قياسي :  التخليص الجمركي النقل تقديم الدعم للعملاء المتواجدين  العمليات على مدار الساعة بما في ذلك تسليم البضائع  تقارير عن حالة الحاوية  خدمات الفرز إعداد تقارير الكترونية مخصصة  لتطوير الخدمات خدمات الكترونية تسهيل المستودعات ( الشحن و التفريغ )  التحقق من وزن الحاويات بوابة OCR الذكية  فحص الحاوية بعد تفريغها  مساعدة شخصية\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question6\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"6\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion7\",\"CMS_Q1\":\"How do I request Extra care?\",\"CMS_INFO1\":\"We are glad to extend all possible assistance wherever practically possible.Kindly feel freeand reach us via your preferred communication channelEmail: c.s@rsgt.com Phone:920007025(Toll Free), from 8 am up to 7 pm all days except Friday WhatsApp 0300073693 Face to face at customer relations front office desk from 7 am up to 7 pm Sunday to Thursdayand from 8 am to 1 pm on Saturday\",\"CMS_Q2\":\"كيف أطلب دعم إضافي ؟\",\"CMS_INFO2\":\"يسعدنا تقديم كل المساعدة الممكنة إن كان ذلك ممكنًا لذلك لا تتردد في التواصل معنا عبر قناة الاتصال المفضلة لديك البريد الالكتروني : C.S@rsgt.com الهاتف المجاني :  920007025 من الساعة 8 ص حتى 7 م يوميا ما عدا الجمعة  الواتساب :  0300073693  مقابلة أحد أعضائنا في مكتب علاقات العملاء من الأحد الى الخميس من الساعة  7 ص الى 7 م و السبت من 8 ص الى 1 م\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question7\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"7\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion8\",\"CMS_Q1\":\"I find damage to my cargo and / or container, whom shall we approach for report?\",\"CMS_INFO1\":\"Complaint of cargo damages must be communicated within 48hrs from delivery.We recommend that surveyor is immediately engaged upon identification of cargo damage. Please approach us per below communication channel:Email: c.s@rsgt.com  Phone: 920007025,Toll Free  RSGT Front desk office Any complain of damage container must be communicated within 24 hours from delivery\",\"CMS_Q2\":\"وجدت تلفًا في شحنتي  /  حاويتي ، فمن سنقوم بالاتصال به للإبلاغ ؟\",\"CMS_INFO2\":\"يجب إرسال شكوى عن أضرار البضائع في غضون 48 ساعة من التسليم. نوصي بأن يتم التلبيغ على الفور عند تحديد تلف البضائع. يرجى التواصل معنا على من خلال قنوات التواصل التالية : البريد الالكتروني : C.S@rsgt.com الهاتف المجاني :  920007025  مكتب علاقات العملاء في محطة بوابة البحر الأحمر  يجب الابلاغ عن اي تلفيات في الحاوية خلال 24 من التسليم .\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question8\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"8\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion9\",\"CMS_Q1\":\"In case of any emergency or information where should I call?\",\"CMS_INFO1\":\"For any emergency inside RSGT,please contact Safety and Security immediately at0556293040 which is available at all times 24 / 7\",\"CMS_Q2\":\"في حالة حدوث أي حدث طاريء أو معلومة , كيف اتواصل معكم ؟\",\"CMS_INFO2\":\"لأي طاريء داخل محطة بوابة البحر الأحمر يرجى الاتصال على الأمن و السلامة على الرقم  0556293040 و المتواجدون على مدار الساعة\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question9\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"9\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion10\",\"CMS_Q1\":\"My container is returned from customs gate (as per my transporter advice), whom shall I approach?\",\"CMS_INFO1\":\"Kindly coordinate with our front desk delivery office or just please reach out to RSGT Customer Relations via your preferred communications channelEmail: c.s@rsgt.com Phone: 920007025(Toll Free),from 8 am up to 7 pm all days except Friday WhatsApp 0300073693 Face to face at customer relations front office desk,from 7 am up to 7 pm Sunday to Thursdayand from 8 am to 1 pm on Saturday\",\"CMS_Q2\":\"تم إرجاع حاويتي من بوابة الجمارك ( بناء على توجية من شركة النقل ) الى من أتوجه للمساعدة ؟\",\"CMS_INFO2\":\"يرجى التنسيق مع مكتب التسليم في مكتب الاستقبال الخاص بنا او التواصل مع مكتب علاقات العملاء عبر  البريد الالكتروني : C.S@rsgt.com  او عبر قنوات التواصل الأخرى  الهاتف المجاني :  920007025 من الساعة 8 ص حتى 7 م يوميا ما عدا الجمعة  الواتساب :  0300073693  مقابلة أحد أعضائنا في مكتب علاقات العملاء من الأحد الى الخميس من الساعة  7 ص الى 7 م و السبت من 8 ص الى 1 م\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question10\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"10\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion11\",\"CMS_Q1\":\"What information do truck drivers need, to pick up or drop off container?\",\"CMS_INFO1\":\"To take delivery of cargo, pre-pick up ticket is required which you can access by sending request per e-mail to: RSGTFRONTDESK @rsgt.com Alternatively, pre-pick up ticket can also be collected from RSGT delivery office To drop off container, carrier needs to upload manifest in Saudi EDI that reflects in RSGT system\",\"CMS_Q2\":\"ماهي المعلومات التي يحتاجها سائقوا الشاحنات أثناء شحن و تفريغ الحاويات ؟\",\"CMS_INFO2\":\"لاستلام البضائع , يرجى الحصول على تذكرة الاسنلام و التي يمكن الحصول عليها عن طريق ارسال طلب عبر البريد الالكتروني الى :  , و يمكن أيضا الحصول على تذكرة الاستلام من مكتب التسليم في محطة بوابة البحر الأحمر لتسليم الحاويات , كما يحتاج الناقل الى إدخال المعلومات المطلوبة في نظام محطة بوابة البحر الأحمر  RSGTFRONTDESK @rsgt.com\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question11\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"11\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion12\",\"CMS_Q1\":\"Which ships are in the port right now?\",\"CMS_INFO1\":\"You may check vessel schedules by visiting: https://etrack.rsgt.com/EtrackWeb/Web/berthingSchedule.aspx\",\"CMS_Q2\":\"ما هي السفن الموجودة في الميناء الآن؟\",\"CMS_INFO2\":\"بالامكان الاطلاع على جداول السفن عبر الرابط التالي : https://etrack.rsgt.com/EtrackWeb/Web/berthingSchedule.aspx\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question12\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"12\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion13\",\"CMS_Q1\":\"What shall I do if my truck has been banned in your terminal?\",\"CMS_INFO1\":\"Kindly contact our Customer Relations immediately and per your preferred communication channel.We strive to facilitate your supply chain requirements and encourage you to reachout to us for any assist\",\"CMS_Q2\":\"ماذا أفعل إذا تم حظر شاحنتي في محطتك؟\",\"CMS_INFO2\":\"يرجى الاتصال بعلاقات العملاء على الفور  من خلال احدى قنوات  الاتصال المفضلة لديك. نحن نسعى جاهدين لتسهيل إجراءات التوريد الخاصة بك ونشجعك على التواصل معنا للحصول على أي مساعدة\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question13\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"13\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion14\",\"CMS_Q1\":\"Do you have safety regulations and policy?\",\"CMS_INFO1\":\"Yes we do and strongly recommend this is adhered to at all times as safety is top priority.\",\"CMS_Q2\":\"هل توجد لديكم لوائح و تنظيمات للسلامة ؟\",\"CMS_INFO2\":\"نعم ، لدينا و نحن نوصي بشدة بالالتزام بذلك في جميع الأوقات لأن السلامة هي الأولوية القصوى\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question14\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"14\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion15\",\"CMS_Q1\":\"My container has been nominated for manual inspection, shall it must pass through the scan inspection too?\",\"CMS_INFO1\":\"Yes it must, and we do this for all containers immediately upon discharge from vessel in order to facilitate fast clearance\",\"CMS_Q2\":\"تم ترشيح الحاوية الخاصة بي للفحص اليدوي ، فهل يجب أن تمر عبر  الفحص الالي أيضًا؟\",\"CMS_INFO2\":\"نعم يجب ذلك ، ونقوم بذلك لجميع الحاويات فور خروجها من السفينة لتسريع عملية التخليص\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question15\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"15\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion16\",\"CMS_Q1\":\"I have a complaint / suggestion / feedback where shall I contact?\",\"CMS_INFO1\":\"The management, and staff of Red Sea Gateway Terminal are interested in what you think about our service.Please deliver your valuable feedback to customer relations drop box placed at our Front Office,or via your preferred communications channel. Hereby - on behalf of our leadership team - assuring you RSGT commitment to listen carefully and strengthening processes furthermore for delivering with ease of business\",\"CMS_Q2\":\"لدي شكوى / اقتراح / ملاحظات كيف يمكنني إيصالها لكم ؟\",\"CMS_INFO2\":\"تهتم إدارة و طاقم محطة بوابة البحر الأحمر  بجميع الآراء حول خدماتنا و يرجى إيصال رأيك عبر صندوق الاقتراحات أو عبر قنوات اللاتصال المفضلة لديك  بموجب هذا الاهتمام وبايعاز من قادة محطة بوابة البحر الأحمر  فأننا نؤكد لك بالتزامنا بالاستماع الى كافة الاراء و المقترحات و العمل على تطوير خدماتنا المقدمة لآداء أعمالكم بكل يسر و سهولة\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question16\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"16\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion17\",\"CMS_Q1\":\"What are working hours for RSGT front office?\",\"CMS_INFO1\":\"We are available Saturday to Thursday. Kindly refer to Q4 and Q5 above for details\",\"CMS_Q2\":\"ماهي ساعات العمل المكتبي لمحطة بوابة البحر الأحمر ؟\",\"CMS_INFO2\":\"نحن متواجدون من السبت الى الخميس , فضلا راجع الأسئلة 4 و 5 لمزيد من التفاصيل\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question17\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"17\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strFrequentlyAskedQuestion18\",\"CMS_Q1\":\"When can we pull-out container from terminal?\",\"CMS_INFO1\":\"Container(s) are delivered 24/7 and can be pulled out any time after payment\",\"CMS_Q2\":\"متى يمكننا إخراج الحاوية من المحطة ؟\",\"CMS_INFO2\":\"يتم تسليم الحاوية (الحاويات) على مدار الساعة طوال أيام الأسبوع ويمكن إخراجها في أي وقت بعد إتمام عملية الدفع\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"strFAQs\",\"CMS_INFODESC\":\"Frequently Asked Question18\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"18\",\"CMS_SORTORDERBASE\":\"1000\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"},{\"CMS_ACCESSID\":\"RM009\",\"CMS_PAGENAME\":\"FAQs\",\"CMS_INFOTYPE\":\"Content\",\"CMS_INFOID\":\"strScreenTitle\",\"CMS_Q1\":\"\",\"CMS_INFO1\":\"FAQs\",\"CMS_Q2\":\"\",\"CMS_INFO2\":\"أسئلة وأجوبة\",\"CMS_CATEGORY\":\"Text\",\"CMS_GROUPREFERENCE\":\"\",\"CMS_INFODESC\":\"Screen Title\",\"CMS_CODE\":\"\",\"CMS_BACKGROUND\":\"#FFFFFF\",\"CMS_FOREGROUND\":\"#000000\",\"CMS_SORTORDER\":\"0\",\"CMS_SORTORDERBASE\":\"2100\",\"CMS_LINK\":\"\",\"CMS_VALUE\":\"\",\"CMS_SUBACCESSID\":\"0\",\"CMS_FLAG\":\"\",\"CMS_CONTROLLENGTH\":\"0\",\"CMS_FILTER\":\"\"}]";
                //objCms = JsonConvert.DeserializeObject<ObservableCollection<Object>>(lstrTemp);
