        public static string getCaption(string fstrElementId, List<InfoItem> fobjInfoItems)
        {
            try
            {


                var Infoitemcms = from objInfoitem in fobjInfoItems
                                  where objInfoitem.cms_infoid == fstrElementId
                                  select new { English = objInfoitem.cms_info1, Arabic = objInfoitem.cms_info2 };


                if (App.gblLanguage == "En") { return Infoitemcms.ToArray()[0].English; }
                else { return Infoitemcms.ToArray()[0].Arabic; }
            }
            catch (Exception ex)
            {
                string strErrorMsg = ex.Message.ToString();

                return fstrElementId.Substring(3, fstrElementId.Length - 3) + "***";
            }
        }



