        public static List<InfoItem> generateList(ObservableCollection<Object> lobjCMS)
        {

            List<InfoItem> llstResult = new List<InfoItem>();

            foreach (IEnumerable<Object> lobjInfoRow in lobjCMS)
            {
                // Info object
                InfoItem lobjinfoitem = new InfoItem();

                foreach (Newtonsoft.Json.Linq.JProperty Column in lobjInfoRow)
                {
                    //  KeyValuePair<string, string[]> Column = (KeyValuePair<string, string[]>)lobjInfoRow.ElementAt(lintIndex);

                    string strColumnName = Column.Name;
                    string strColumnValue = Column.Value.ToString();

                    switch (strColumnName)
                    {
                        case "cms_code":
                            lobjinfoitem.cms_code = strColumnValue;
                            break;

                        case "cms_info1":
                            lobjinfoitem.cms_info1 = strColumnValue;
                            break;

                        case "cms_info2":
                            lobjinfoitem.cms_info2 = strColumnValue;
                            break;

                        case "cms_infodesc":
                            lobjinfoitem.cms_infodesc = strColumnValue;
                            break;

                        case "cms_image":
                            lobjinfoitem.cms_image = strColumnValue;
                            break;


                        case "cms_link":
                            lobjinfoitem.cms_link = strColumnValue;
                            break;

                        case "cms_infoid":
                            lobjinfoitem.cms_infoid = strColumnValue;
                            break;

                        case "cms_value":
                            lobjinfoitem.cms_value = strColumnValue;
                            break;

                        case "cms_groupreference":
                            lobjinfoitem.cms_groupreference = strColumnValue;
                            break;

                        case "cms_category":
                            lobjinfoitem.cms_category = strColumnValue;
                            break;

                        case "cms_q1":
                            lobjinfoitem.cms_q1 = strColumnValue;
                            break;


                        case "cms_q2":
                            lobjinfoitem.cms_q2 = strColumnValue;
                            break;

                    }

                }
                llstResult.Add(lobjinfoitem);

            }

            return llstResult;

        }

    }

