        public static string BuildJsonProperty(string fstrPropName, string fstrValue)
        {
            StringBuilder strJsonProp = new StringBuilder();

            strJsonProp.AppendFormat("\"{0}\":\"{1}\",", fstrPropName, fstrValue);
            return strJsonProp.ToString();
        }

        public static string DamageAcceptMailData()
        {
            string strCode = "Damage-Accept";
            StringBuilder strDamageAccept = new StringBuilder("{");
            strDamageAccept.AppendFormat(BuildJsonProperty("SMT_CODE", strCode));
            strDamageAccept.AppendFormat(BuildJsonProperty("RU_EMAILID", gblRegisteration.strLoginUser));
            strDamageAccept.AppendFormat("\"{0}\":\"{1}\"}}", "RU_FIRSTNAME1", gblRegisteration.strLoginFirstName);

            return strDamageAccept.ToString();

        }
    }



